import React, { Component } from 'react';
import './Header.css';


 class AltHeader extends Component {
    render() {
        return (
            <header className='AltHeader'>
            <h>Bu poje <b>Emre Can TURAL</b> tarafından yapılmıştır. TÜBİTAK BİLGEM YTE-2019</h>          
            </header>

        )
    }
}
export default AltHeader;
